import { useState } from "react";
import "./App.css";

function App() {
  const [number, setNumber] = useState(Math.floor(Math.random() * 100) + 1);
  const randomNumber = () => {
    setNumber();
  };
  return (
    <div className="App">
      <header className="App-header">
        <div>{number}</div>
        <button onClick={randomNumber}>Create new number</button>
      </header>
    </div>
  );
}

export default App;
